  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>À propos de cette application</h2><p>Cette application vous est fournie par PharmaLedger®. Ellea été développée conjointement par des organisations représentatives des patients, des entreprises pharmaceutiques et des experts en technologie.</p><p>Elle permet aux utilisateurs de consulter des informations sur leur médicament en scannant le code-barres présent sur l'emballage du produit.</p><p>Les informations présentées sont fournies par le titulaire de l’autorisation de mise sur le marché du produit.</p><h2>À propos de PharmaLedger</h2><p>PharmaLedger® est le nom de marque de l’Association PharmaLedger (PLA).</p><p>PLA est une association mondiale neutre et à but non lucratif. L'objectif de l'association est de créer et de promouvoir un écosystème de confiance numérique dans le domaine de la santé.</p><p>L'association promeut la coopération dans les secteurs de la santé et des sciences de la vie et promeut les innovations et leur mise en œuvre pour le bénéfice mutuel des patients et des autres parties prenantes.</p>",
